    return(item.text)
  })

    // console.log(ingredients[0].text);
  return(
    <div className="recipe-container">
      <div className="item-list_container">

        <h4>{this.props.label}</h4>
        <img src={this.props.image} alt='' />
        <div>
        {ingredients}
        </div>
        <div>
        {this.props.url}
        </div>

      </div>
    </div>
  )
}
}

